window.bookSummaryJSON = "<p><b>Randidly Ghosthound felt lost and alone even before the System transformed the Earth. Before every person had to deal with the sudden presence of levels, skills, monsters, and the very real possibility of death....</b></p> <p>Due to unusual circumstances, Randidly starts in an isolated dungeon far beyond his level, forced to rely on the mysterious Traveler Shal in order to learn and survive with the dangerous new status quo for his world.</p> <p>But survive he does, only to leave the dungeon and discover that while he experienced several hellish months in the dungeon, only half a day passed on Earth. Randidly's capabilities are now more than enough to help build a small enclave of survivors, but that doesn't mean balancing his sense of responsibility against the plots of an unfriendly town will be easy.</p> <p>And although he doesnâ€™t know it, he needs to prepare. Because the System has sent down a tribulation, which waits in the shadows and monitors his every move....</p> <p><b>Experience the start of this hit LitRPG fantasy series with more than 50 million views on Royal Road. </b></p>"; 
